ArtMAX MAGAZINE presents
ESSENCE ‚Äì Launching of ArtMAX MAGAZINE VOL. 11
„Éª
ArtMAX MAGAZINE adalah majalah DKV dan interior terbitan BEM FSRD UNTAR. Kali ini ArtMAX MAGAZINE merilis volume 11 yang bertemakan LESS IS MORE. Singkatnya, simplicity dan minimalism bermakna bahwa desainer harus berfokus kepada esensi karyanya
„Éª
Esensi masih dipertanyakan dalam pengaplikasiannya dalam konteks desain. Pertanyaan terbesarnya adalah apa dan bagaimana langkah tepat untuk menampilkan esensi dari sebuah karya?
„Éª
ESSENCE juga akan dimeriahkan dengan:
- The Essence of Branding from a Packaging Talkshow, bekerjasama dengan DGI
- The Essence of Local Content‚Äôs Furniture: Rattan, oleh Abie Abdillah - Studio Hiji
- Smartphone Food Videography Workshop, oleh William Budiyana & Anita Agustine
- 3D Printing & Moulding Workshop, oleh 3D Solution & Dennys
- Creative Market
- Pameran Karya Terbaik Mahasiswa FSRD UNTAR
„Éª
Date: April 29th ‚Äì May 5th 2017
Opening: April 29th 2017, 11.00 AM
Venue: IDDC (Indonesian Design Development Center) Jl. Letjen S. Parman No.112 Jakarta

